import React from 'react';
import { Link, useNavigate } from 'react-router-dom';
import './HomePage.css';

const HomePage = () => {
  const navigate = useNavigate();
  const isAuthenticated = localStorage.getItem('isAuthenticated');

  const handleGetStarted = () => {
    navigate(isAuthenticated ? '/dashboard' : '/signup');
  };

  // Simplified navigation links to only existing routes
  const navLinks = [
    { path: '/features', label: 'Features' },
    { path: '/about', label: 'About' }
  ];

  return (
    <div className="home-page">
      <nav className="navbar">
        <div className="container">
          <div className="logo">YourApp</div>
          <div className="nav-links">
            {navLinks.map((link, index) => (
              <Link key={index} to={link.path}>{link.label}</Link>
            ))}
            {isAuthenticated ? (
              <Link to="/dashboard" className="btn-secondary">Dashboard</Link>
            ) : (
              <>
                <Link to="/login" className="btn-secondary">Login</Link>
                <Link to="/signup" className="btn-primary">Sign Up</Link>
              </>
            )}
          </div>
        </div>
      </nav>

      {/* ... rest of the component remains similar but with existing routes only ... */}
      
      <footer className="footer">
        <div className="container">
          <div className="footer-content">
            {/* Only include links to existing routes */}
            <div className="footer-section">
              <h4>Product</h4>
              <Link to="/features">Features</Link>
            </div>
            <div className="footer-section">
              <h4>Company</h4>
              <Link to="/about">About</Link>
            </div>
          </div>
          <div className="footer-bottom">
            <p>Â© 2023 YourApp. All rights reserved.</p>
          </div>
        </div>
      </footer>
    </div>
  );
};

export default HomePage;
